import React, { useEffect, useState } from "react";
import Button from "../button/Button";
function Showdata(props) {
  var whichcomp = "";
  useEffect(() => {
    //componentdidmount function
    fetchItems();
  }, []);

  const [items, setItems] = useState([]);

  const fetchItems = async () => {
    ///////////didmount ued hiih ymnuud
    const getdata = new URLSearchParams(props.location.ugugdul);
    for (let a of getdata.entries()) {
      whichcomp = a[0];
    }
    const data = await fetch("/showdata");
    const items = await data.json();
    setItems(items);
  };

  const code_inquiry = (
    <div>
      <section>
        {items.map((item) => (
          <div>
            <h1>This is from inquiry</h1>
            <p>{item.name}</p>
            <p>{item.number}</p>
            <p>{item.height}</p>
            <Button txt="Back"></Button>
          </div>
        ))}
      </section>
    </div>
  );
  const code_invoice = (
    <div>
      <section>
        {items.map((item) => (
          <div>
            <h1>This is from invoice</h1>
            <p>{item.name}</p>
            <p>{item.number}</p>
            <Button txt="Back"></Button>
          </div>
        ))}
      </section>
    </div>
  );
  const code_tokens = (
    <div>
      <section>
        {items.map((item) => (
          <div>
            <h1>This is from tokens</h1>
            <p>{item.name}</p>
            <p>{item.height}</p>
            <Button txt="Back"></Button>
          </div>
        ))}
      </section>
    </div>
  );

  switch (whichcomp) {
    case "inquiry":
      return code_inquiry;
      break;
    case "invoice":
      return code_invoice;
      break;
    case "tokens":
      return code_tokens;
      break;
    default:
      break;
  }
}

export default Showdata;
